import React from 'react';
import { Box, Typography, Button, Card, CardMedia, CardContent, CardActions, Chip } from '@material-ui/core';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import PhoneIcon from '@material-ui/icons/Phone';
import Rating  from '@material-ui/lab/Rating';

import useStyles from './styles';

const PlaceDetails = ({place}) => {
    const classes = useStyles();
    
    return (
        <Card elevation={6}>
            <CardMedia
            style={{height:350}}
            image={place.photo? place.photo.images.large.url:'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.oyorooms.com%2Fhotels-in-sector-43-chandigarh%2F&psig=AOvVaw2zEVlghARJswe8LAzzc37-&ust=1669094098841000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCND_hJnCvvsCFQAAAAAdAAAAABAJ'}
            title={place.name}
            />
            <CardContent>
                <Typography gutterBottom variant="h5">{place.name}</Typography>
            </CardContent>

        </Card>
    );
}

export default PlaceDetails;
